import { Component } from "react";

class Users extends Component {
  constructor(props) {
    super(props);
    this.state = {
      users: [],
    };
  }

  componentDidMount() {
    fetch("/api/users").then((res) =>
      res.json().then((users) => {
        this.setState({ users: users });
      })
    );
  }

  render() {
    return (
      <div>
        <h1>Text from users</h1>
      </div>
    );
  }
}

export default Users;
